// About.js
import React from 'react';
import './About.css'; // Make sure to create an About.css file in the same directory

function About() {
  return (
    <div className="about-container">
      <h1 className="about-title">About Us</h1>
      <p className="about-description">
        Welcome to our website! We are passionate about providing delicious recipes and culinary inspiration to food enthusiasts around the world. Our team is dedicated to searching for the best ingredients, experimenting with new flavors, and perfecting dishes that can be enjoyed by everyone. Whether you're a beginner cook or a seasoned chef, we hope to inspire your next culinary adventure.
      </p>
      {/* Add more content as needed */}
    </div>
  );
}

export default About;
